function b64DecodeUnicode(str) {
    return decodeURIComponent(atob(str).split('').map(function(c) {
        return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
    }).join(''));
}

function sleep (time) {
    return new Promise((resolve) => setTimeout(resolve, time));
}

function preProcess(text){
    text = text.replace(/\s+/g, ' ');
    text = text.replace(/\r?\n|\r/g, " ");
    text = text.replace(/>/g, " > ");
    text = text.replace(/</g, " <");
    text = Encoder.htmlDecode(text);
    return text;
}


//preprocessing
function wordsCount(splited_text){
    var result = [];
    var words_set = new Set(splited_text);
    var words = Array.from(words_set);
    for (var i=0; i<words.length; i++){
        result.push([words[i],splited_text.count(words[i])]);
    }
    return result;
}

//preprocessing
function rm_element(arr, value){
    arr = arr.filter(function(item) { 
        return item !== value;
    })
    return arr;
}

//preprocessing
function removeSpaces(splited_text){
    splited_text = rm_element(splited_text, "");
    splited_text = rm_element(splited_text, " ");
    return splited_text;
}

//preprocessing
function getWords(text){
    splited_text = text.split(" ");
    splited_text = removeSpaces(splited_text);
    return wordsCount(splited_text);
}

// identify added and removed terms
function signature(a, b){
    var removed = [];
    var added = [];
    for (var [key, value] of b.entries()){
        if (a.has(key)){
            if (a.get(key) < value)
                removed.push(key)
        } else
        removed.push(key)
    }
    for (var [key, value] of a.entries()){
        if (b.has(key)){
            if (b.get(key) < value)
                added.push(key)
        } else
        added.push(key)
    }
    return [added, removed]
}


function isSuperset(set, subset) {
    for (let elem of subset) {
        if (!set.has(elem)) {
            return false
        }
    }
    return true
}

function difference(setA, setB) {
    let _difference = new Set(setA)
    for (let elem of setB) {
        _difference.delete(elem)
    }
    return _difference
}

